    public static ArrayList<Long> factorize(long n) {
        ArrayList<Long> res = new ArrayList<>();
        ArrayList<Long> resTmp = new ArrayList<>();
        long p = 2;
        while (n != 1) {
            if (n % p == 0) {
                n /= p;
                resTmp.add(p);
            } else {
                p++;
            }
        }
        for (Long i : resTmp) {
            if (res.size() == 0 || res.get(res.size() - 1) != i) {
                res.add(i);
            } else {
                ((List<Long>) res).set(res.size() - 1, i + 1);
            }
        }
        return res;

