        ArrayList<Long> ans = new ArrayList<>();
        long t = 2;
        while (t <= Math.sqrt(n)) {
            if (n % t == 0) {
                ans.add(t);
                n /= t;
            } else {
                t++;
            }
        }
        if (n > 1) {
